(2, 'Basic 1 Month', 30.00, 300, 10, 30, 'বেসিক প্ল্যান (Basic Plan)\nদৈনিক ১০টি এবং মাসিক ৩০০টি পর্যন্ত অর্ডার তৈরি করার সুবিধা।\n\nযারা অল্প খরচে কার্যকরভাবে ব্যবসা শুরু করতে চান, তাদের জন্য এই প্ল্যানটি সেরা।', 1, 0, 0, 0, 0, 0),
(3, 'Pro 1 month', 50.00, 1200, NULL, 30, 'প্রো প্ল্যান (Pro Plan)\nমাসিক ১২০০টি পর্যন্ত অর্ডার তৈরির সুবিধা, কোনো দৈনিক লিমিট নেই।\n\nফিচারসমূহ:\n\n✅ কাস্টমার রিস্ক চেক (Check Risk)\n\n\nবেসিক প্ল্যানের সকল সুবিধার পাশাপাশি আরও বেশি অর্ডার তৈরির সুযোগ থাকায় এটি ক্রমবর্ধমান ব্যবসার জন্য উপযুক্ত।', 1, 0, 0, 1, 0, 0),
(6, 'Ultra 1 Month', 100.00, 3000, NULL, 30, 'আলট্রা প্ল্যান (Ultra Plan)\nমাসিক ৩০০০টি পর্যন্ত অর্ডার তৈরির বিশাল সুযোগ।\n\nফিচারসমূহ:\n\n✅ AI ব্যবহার করে ঠিকানা সংশোধন (Correct Address with AI)\n\n✅ কাস্টমার রিস্ক চেক (Check Risk)\n\n\nবড় আকারের ই-কমার্স বা কুরিয়ার ব্যবসার জন্য প্রয়োজনীয় সকল সুবিধা এই প্ল্যানে অন্তর্ভুক্ত।', 1, 1, 0, 1, 1, 0);
