('help_content', '<style>\r\n    .help-guide {\r\n        font-family: Arial, sans-serif;\r\n        line-height: 1.6;\r\n        color: #333;\r\n    }\r\n    .help-guide h1 {\r\n        color: #d72129;\r\n        border-bottom: 2px solid #d72129;\r\n        padding-bottom: 10px;\r\n        font-size: 24px;\r\n    }\r\n    .help-guide h2 {\r\n        color: #4a4a4a;\r\n        margin-top: 30px;\r\n        border-left: 4px solid #d72129;\r\n        padding-left: 10px;\r\n        font-size: 20px;\r\n    }\r\n    .help-guide h3 {\r\n        color: #666;\r\n        margin-top: 20px;\r\n        font-size: 18px;\r\n        border-bottom: 1px dashed #eee;\r\n        padding-bottom: 5px;\r\n    }\r\n    .help-guide p {\r\n        margin-bottom: 15px;\r\n    }\r\n    .help-guide ul, .help-guide ol {\r\n        margin-left: 20px;\r\n        margin-bottom: 15px;\r\n    }\r\n    .help-guide li {\r\n        margin-bottom: 8px;\r\n    }\r\n    .help-guide code {\r\n        background-color: #f4f7f9;\r\n        border: 1px solid #dfe6ee;\r\n        border-radius: 4px;\r\n        padding: 2px 6px;\r\n        font-family: monospace;\r\n        color: #d72129;\r\n    }\r\n    .help-guide .premium-feature {\r\n        background-color: #fffbe6;\r\n        border-left: 4px solid #f39c12;\r\n        padding: 10px 15px;\r\n        margin: 15px 0;\r\n        border-radius: 4px;\r\n    }\r\n    .help-guide .premium-feature strong {\r\n        color: #f39c12;\r\n    }\r\n    .help-guide .note {\r\n        background-color: #e9f7ec;\r\n        border-left: 4px solid #28a745;\r\n        padding: 10px 15px;\r\n        margin: 15px 0;\r\n        border-radius: 4px;\r\n    }\r\n    .help-guide .video-container {\r\n        position: relative;\r\n        overflow: hidden;\r\n        width: 100%;\r\n        padding-top: 56.25%; /* 16:9 Aspect Ratio */\r\n        margin: 15px 0;\r\n        border-radius: 8px;\r\n        box-shadow: 0 4px 8px rgba(0,0,0,0.1);\r\n    }\r\n    .help-guide .video-container iframe {\r\n        position: absolute;\r\n        top: 0;\r\n        left: 0;\r\n        width: 100%;\r\n        height: 100%;\r\n        border: none;\r\n    }\r\n</style>\r\n\r\n<div class=\"help-guide\">\r\n    <h1>AiParcel ব্যবহার করার নির্দেশিকা</h1>\r\n    <p>AiParcel -এ আপনাকে স্বাগতম! আমাদের এই স্মার্ট পার্সেল এন্ট্রি সিস্টেম আপনার শিপিং প্রক্রিয়াকে আরও সহজ এবং দ্রুত করার জন্য ডিজাইন করা হয়েছে। নিচে এর বিভিন্ন ফিচার ব্যবহারের নিয়ম বিস্তারিত আলোচনা করা হলো।</p>\r\n\r\n    <h3>How to use AiParcel (যেভাবে আমাদের ওয়েবসাইট ব্যাবহার করবেন)</h3>\r\n    <p>AiParcel কিভাবে ব্যাবহার করবেন বুঝতে নিচের ভিডিওটি দেখুন। এটি আপনাকে ধাপে ধাপে প্রক্রিয়াটি বুঝতে সাহায্য করবে:</p>\r\n    <div class=\"video-container\">\r\n        <iframe src=\"https://www.youtube.com/embed/Ayk0JNIOT1o\" title=\"How to use AiParcel (যেভাবে আমাদের ওয়েবসাইট ব্যাবহার করবেন)\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>\r\n    </div>\r\n\r\n    <h2>১. স্টোর ম্যানেজমেন্ট</h2>\r\n    <p>একাধিক কুরিয়ার সার্ভিস এবং শপের তথ্য সংরক্ষণের জন্য \'স্টোর ম্যানেজমেন্ট\' একটি গুরুত্বপূর্ণ ফিচার।</p>\r\n    <ol>\r\n        <li>ন্যাভিগেশন বার থেকে <strong>\"Manage Stores\"</strong> বাটনে ক্লিক করুন।</li>\r\n        <li>\r\n            <strong>নতুন স্টোর যুক্ত করতে:</strong>\r\n            <ul>\r\n                <li>\"Add / Edit Store\" সেকশনে যান।</li>\r\n                <li>ড্রপডাউন থেকে আপনার কুরিয়ার সার্ভিস (যেমন: Steadfast বা Pathao) নির্বাচন করুন।</li>\r\n                <li>আপনার শপের একটি নাম দিন (যেমন: My Daraz Shop)।</li>\r\n                <li>কুরিয়ার অনুযায়ী প্রয়োজনীয় তথ্য (API Key, Secret Key, Client ID ইত্যাদি) সঠিকভাবে পূরণ করুন।</li>\r\n                <li><strong>\"Add Store\"</strong> বাটনে ক্লিক করে সেভ করুন।</li>\r\n            </ul>\r\n        </li>\r\n        <li><strong>স্টোর এডিট বা ডিলিট করতে:</strong> \"Your Saved Stores\" তালিকা থেকে নির্দিষ্ট স্টোরের পাশে থাকা \"Edit\" বা \"Delete\" (×) বাটনে ক্লিক করুন।</li>\r\n    </ol>\r\n    <div class=\"note\">\r\n        <strong>গুরুত্বপূর্ণ:</strong> অর্ডার তৈরি করার আগে আপনাকে অবশ্যই কমপক্ষে একটি স্টোর যুক্ত করতে হবে।\r\n    </div>\r\n\r\n    <h2>২. পার্সেল তথ্য পার্সিং</h2>\r\n    <p>আপনি বিভিন্ন উপায়ে আপনার পার্সেলের তথ্য আমাদের সিস্টেমে যুক্ত করতে পারেন।</p>\r\n    \r\n    <h3>লোকাল পার্সিং (Parse Locally)</h3>\r\n    <p>এই পদ্ধতিতে, আপনাকে নির্দিষ্ট ফরম্যাট অনুযায়ী তথ্য সাজিয়ে টেক্সট-বক্সে পেস্ট করতে হবে।</p>\r\n    <ol>\r\n        <li>প্রথমে <strong>\"Parser Settings\"</strong> থেকে আপনার প্রয়োজনীয় ফিল্ডগুলো (যেমন: OrderID, Customer Name, Amount, Address, Phone) 순서 মতো সাজিয়ে নিন।</li>\r\n        <li>আপনার পার্সেলের তথ্যগুলো ওই 순서 অনুযায়ী লাইন বাই লাইন সাজান। নিচের উদাহরণ দেখুন:</li>\r\n    </ol>\r\n    <pre><code>ABC-123\r\nRahim Khan\r\n500\r\nHouse 10, Road 5, Mirpur, Dhaka\r\n01700000000</code></pre>\r\n    <p>একাধিক পার্সেল যোগ করতে চাইলে, প্রতিটি পার্সেলের তথ্যের মাঝে একটি করে <strong>ফাঁকা লাইন</strong> দিন।</p>\r\n    <p>সঠিকভাবে পেস্ট করার পর <strong>\"Parse Locally\"</strong> বাটনে ক্লিক করলে নিচের টেবিলে পার্সেলগুলো দেখতে পাবেন।</p>\r\n\r\n    <h3>AI এর মাধ্যমে পার্সিং (Parse with AI)</h3>\r\n    <div class=\"premium-feature\">\r\n        <strong>প্রিমিয়াম ফিচার:</strong> এটি একটি প্রিমিয়াম ফিচার এবং নির্দিষ্ট প্ল্যানের ব্যবহারকারীদের জন্য প্রযোজ্য।\r\n    </div>\r\n    <p>এই পদ্ধতিতে আপনাকে কোনো ফরম্যাট মানতে হবে না। শুধুমাত্র আপনার পার্সেলের সমস্ত তথ্য টেক্সট-বক্সে পেস্ট করুন এবং <strong>\"Parse with AI\"</strong> বাটনে ক্লিক করুন। আমাদের AI সিস্টেম স্বয়ংক্রিয়ভাবে তথ্যগুলো শনাক্ত করে টেবিলে যুক্ত করবে।</p>\r\n\r\n    <h2>৩. অর্ডার তৈরি করা</h2>\r\n    <p>পার্সেলগুলো পার্স করার পর কুরিয়ারে অর্ডার তৈরি করা খুবই সহজ।</p>\r\n    <ol>\r\n        <li>প্রথমেই <strong>\"Select Store for this Batch\"</strong> ড্রপডাউন থেকে আপনার পছন্দের স্টোরটি সিলেক্ট করুন।</li>\r\n        <li>আপনার পার্সেল তথ্য পার্স করুন (লোকাল বা AI পদ্ধতিতে)।</li>\r\n        <li>নিচের টেবিলে প্রতিটি পার্সেলের তথ্য পর্যালোচনা করুন। কোনো ভুল থাকলে ডিলিট (×) করে আবার পার্স করতে পারেন।</li>\r\n        <li>সবকিছু ঠিক থাকলে <strong>\"Create Order(s)\"</strong> বাটনে ক্লিক করুন। বাটনটির নাম আপনার নির্বাচিত স্টোরের কুরিয়ার অনুযায়ী (যেমন: Create Steadfast Order(s)) পরিবর্তিত হতে পারে।</li>\r\n        <li>অর্ডার সফলভাবে তৈরি হলে আপনি নিচে API Response দেখতে পাবেন।</li>\r\n    </ol>\r\n    \r\n    <h2>৪. বিশেষ ফিচারসমূহ</h2>\r\n    \r\n    <h3>ঠিকানা সংশোধন (Correct Address 🤖 AI)</h3>\r\n    <div class=\"premium-feature\">\r\n        <strong>প্রিমিয়াম ফিচার:</strong> এটি একটি প্রিমিয়াম ফিচার।\r\n    </div>\r\n    <p>পার্সেল কার্ডের পাশে থাকা এই বাটনে ক্লিক করলে AI ব্যবহার করে অসম্পূর্ণ বা ভুল ঠিকানা স্বয়ংক্রিয়ভাবে সঠিক ফরম্যাটে (সম্পূর্ণ ঠিকানা, থানা, জেলা) রূপান্তরিত হবে।</p>\r\n\r\n    <h3>ঝুঁকি যাচাই (Check Risk)</h3>\r\n    <div class=\"premium-feature\">\r\n        <strong>প্রিমিয়াম ফিচার:</strong> এটি একটি প্রিমিয়াম ফিচার।\r\n    </div>\r\n    <p>এই বাটনে ক্লিক করে আপনি গ্রাহকের ফোন নম্বর দিয়ে বিভিন্ন কুরিয়ার সার্ভিসে তার পূর্ববর্তী রেকর্ড যাচাই করতে পারবেন। যেমন: মোট অর্ডার, ডেলিভারি এবং ক্যানসেল রেট। এর মাধ্যমে আপনি ঝুঁকিপূর্ণ গ্রাহক শনাক্ত করতে পারবেন।</p>\r\n\r\n    <h2>৫. কুরিয়ার API কী (Key) কিভাবে পাবেন?</h2>\r\n    <p>কুরিয়ার সার্ভিস ব্যবহার করার জন্য তাদের API কী প্রয়োজন। নিচে Steadfast এবং Pathao-এর জন্য API কী পাওয়ার নির্দেশনা দেওয়া হলো:</p>\r\n    \r\n    <h3>Steadfast API Key</h3>\r\n    <p>Steadfast-এর API কী পেতে নিচের ভিডিওটি দেখুন। এটি আপনাকে ধাপে ধাপে প্রক্রিয়াটি বুঝতে সাহায্য করবে:</p>\r\n    <div class=\"video-container\">\r\n        <iframe src=\"https://www.youtube.com/embed/VGrBSO-AXu4\" title=\"How to get Steadfast API Key\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>\r\n    </div>\r\n    \r\n    <h3>Pathao API Key</h3>\r\n    <p>Pathao-এর API কী পাওয়ার জন্য বিস্তারিত জানতে নিচের ভিডিওটি দেখতে পারেন:</p>\r\n    <div class=\"video-container\">\r\n         <iframe src=\"https://www.youtube.com/embed/AIGyAzo-vZc\" title=\"How to get Pathao API Key\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>\r\n    </div>\r\n\r\n    <h2>৬. আপনার প্ল্যান ও প্রোফাইল</h2>\r\n    <p>ড্যাশবোর্ডের উপরের দিকে আপনি আপনার বর্তমান প্ল্যানের নাম, অর্ডারের লিমিট এবং মেয়াদ উত্তীর্ণের তারিখ দেখতে পাবেন।</p>\r\n    <ul>\r\n        <li><strong>\"Upgrade Plan\"</strong> বাটনে ক্লিক করে আপনি সহজেই আপনার বর্তমান প্ল্যান থেকে উচ্চতর প্ল্যানে আপগ্রেড করতে পারবেন।</li>\r\n        <li><strong>\"Profile Settings\"</strong> থেকে আপনি আপনার নাম এবং পাসওয়ার্ড পরিবর্তন করতে পারবেন।</li>\r\n    </ul>\r\n    \r\n    <h2>৭. যোগাযোগ</h2>\r\n    <p>যেকোনো প্রয়োজনে আমাদের সাথে যোগাযোগ করুন:</p>\r\n    <ul>\r\n        <li><strong>ফোন:</strong> ০১৮৮৪ ০৩১১১১</li>\r\n        <li><strong>ইমেইল:</strong> rodalsoft@gmail.com</li>\r\n    </ul>\r\n    <p>ধন্যবাদ!</p>\r\n</div>'),
('show_ai_parse_button', '1'),
